$templateCache.put('help/search/search.html','<div class="sheet"><div class="sheet__sheet"><div class="sheet__title-bar"><h2 class="sheet__title">Search Help</h2></div><a class="sheet__close-button" ng-click="vm.closeHelp()">&nbsp;</a><div class="sheet__inner"><div class="sheet__block"><h2 class="sheet__block-title">Search suggestions</h2><p class="sheet__block-content sheet__block-content--90">When you start typing in the search field, suggestions and previous searches will show up. ie.</p><div class="sheet__block-block"><p class="sheet__block-content sheet__block-content--90">metadata</p></div><p class="sheet__block-content sheet__block-content--90">will show all available keys of the TAG metadata.</p><p class="sheet__block-content sheet__block-content--90">Upon selecting/typing a key the search will expect a value to search for. ie.</p><div class="sheet__block-block"><p class="sheet__block-content sheet__block-content--90">metadata.city=Chicago</p></div></div><div class="sheet__block"><h2 class="sheet__block-title">Add filters</h2><p class="sheet__block-content sheet__block-content--90">You can add a search string as a filter and create as many filters as you want. Applied filters will use the AND operator to link criteria statements</p></div><div class="sheet__block"><h2 class="sheet__block-title">Multi-value queries</h2><p class="sheet__block-content sheet__block-content--90">The white space between words, quoted strings, numbers, and dates is treated as an implicit AND operator.</p><div class="sheet__block-block"><p class="sheet__block-content sheet__block-content--90">TX Eastland<br>TX AND Eastland</p></div></div><div class="sheet__block"><h2 class="sheet__block-title">Key = Value search</h2><p class="sheet__block-content sheet__block-content--90">A key=value search looks for values in tag keys, by key name. A key=value search query string is composed of one or more expressions that specify a key name, a relational operator, and a value. The available relational operators depend on the type of the key. The equality operator, represented by either a colon or the equals sign, can be used for all field types. Here are some key=value query strings for different types of fields:</p><div class="sheet__block-block"><p class="sheet__block-content sheet__block-content--90">city &#61; Pioneer<br>country &#61; USA<br>NOT state &#61; CA<br>score &#62; 500<br>startdate &#62; &#61 2011-05-10</p></div></div><div class="sheet__block"><h2 class="sheet__block-title">TAG: specific search</h2><p class="sheet__block-content sheet__block-content--90">Look for specific tag keys values, by specifying a tag. Use the filter option to create a query.</p><div class="sheet__block-block"><p class="sheet__block-content sheet__block-content--90">premise.city &#61; San Diego<br>datasource.id &#61; 123456789<br>metadata.market &#61; ERCOT</p></div></div><div class="sheet__block"><h2 class="sheet__block-title">Boolean operators</h2><p class="sheet__block-content sheet__block-content--90">You can specify a more complex global search by using the boolean operator NOT before a value, and the operators AND and OR between values. Note that these operators must be written in upper case. If they appear within a quoted string they are treated as part of the field value, not as operators. You can use parentheses in a query string make the logic clear..</p><div class="sheet__block-block"><p class="sheet__block-content sheet__block-content--90">NOT city=Pioneer AND Secondary OR Subtransmission<br><strong>results in</strong><br>(NOT city=Pioneer) AND (Secondary OR Subtransmission)<br><br>NOT Chicago OR WP-GP30SD AND COMED<br><strong>results in</strong><br>((NOT Chicago) OR WP-GP30SD) AND COMED</p></div></div></div></div></div>');
